function selectionSort(arr){
    let isSorted = false
    for(let i = 0; i < arr.length && !isSorted; i++){
        if(i === 0){
            isSorted = true
        }
        let minValue = arr[i], position = i
        for(let j = i + 1; j < arr.length; j++){
            if(arr[j] < minValue){
                minValue = arr[j]
                position = j
                isSorted = false
            }
        }
        if(minValue !== arr[i]){
            [arr[i], arr[position]] = [arr[position], arr[i]]
        }
    }
    return arr
}

